The problem that test tries to create content file with name `1395172871430` that is already exists in database. I've no ideas how file with this timestamp(actually name of file is string representation of `System.currentTimeMillis()`) was already created in repo. 
In anyways, I think that probably we should cleanup all files that we created in repo with our test after test is completed. I mean we probably should use this construction:
`//create file 
try {
//do test
} finally{
//delete test file
}`  
This allows us to avoid conflicts I hope.

